import React, {Component} from 'react';   
class Match extends Component {

    constructor(props){
        super(props)
        this.state = { 
            match:'',
        }
     }
    
    render() { 
        const { match } = this.props;
       
        if (!match.data)
            return <div>Empty</div>;

        let tagText = '';
      
        console.log(match);

        console.log("========================");
            if (match.type === 'matches') {
                 match.data.map((item, i) => {
                 console.log("Matches : ",item.title);
                 tagText = item.title; 
                 });
            }

            if (match.type === 'videos') {
                match.data.map((item, i) => {
                    console.log("Videos : ",item.title);
                    tagText = item.title;
                });
            }

            if (match.type === 'news') {
                match.data.map((item, i) => {
                    console.log("News : ",item.title);
                    tagText = item.title;
                });
            }

            if (match.type === 'articles') {
                match.data.map((item, i) => {
                    console.log("Articles : ",item.title);
                    tagText = item.title;
                });
            }

        return <div> {tagText}</div>;

    }
}

export default Match;
